import React from 'react';

function Header(props) {
  return (
    <header>
      <h1>OUR STORE</h1>
      <Button color="inherit" onClick={()=>{props.showCart(!props.cart.show)}} >Cart ({props.cart.count})</Button>
    </header>
  );
}

export default Header;
